import { default as React, useEffect } from "react";
import Swiper, { SwiperSlide } from 'swiper';
import 'swiper/css';
import 'swiper/css/effect-cube';
import 'swiper/css/pagination';
import { EffectCube, Pagination } from 'swiper/modules';
import CarouselComponent from "../components/CarouselComponent";
import './Home.css';

function Home(props) {
  useEffect(() => {
    props.setProgress(50);
    setTimeout(() => {
      props.setProgress(100);
    }, 500);
  }, []);

  return (
    <>
      <section id="section1">
        <CarouselComponent />
      </section>

      <section className="my-3" id="section2">
        <h1 className="text-center" style={{ color: "whitesmoke" }}>Some Content</h1>
      </section>

      <section className="my-3" id="section3">
        <h2 className="text-center" style={{ color: "whitesmoke" }}>Available for</h2>
        <div className="my-3 text-center">
          <Swiper
            effect={'cube'}
            grabCursor={true}
            cubeEffect={{
              shadow: true,
              slideShadows: true,
              shadowOffset: 20,
              shadowScale: 0.94,
            }}
            pagination={false}
            modules={[EffectCube, Pagination]}
            autoplay={{
              delay: 1000, // Set the delay in milliseconds (adjust as needed)
              disableOnInteraction: false, // Allow manual interaction to not stop autoplay
            }}
            loop={true} // Enable loop if you want continuous rotation
            className="mySwiper"
          >
            <SwiperSlide>
              <img src="https://swiperjs.com/demos/images/nature-1.jpg" alt="Slide 1" />
            </SwiperSlide>

            <SwiperSlide>
              <img src="https://swiperjs.com/demos/images/nature-2.jpg" alt="Slide 2" />
            </SwiperSlide>

            <SwiperSlide>
              <img src="https://swiperjs.com/demos/images/nature-3.jpg" alt="Slide 3" />
            </SwiperSlide>

            <SwiperSlide>
              <img src="https://swiperjs.com/demos/images/nature-4.jpg" alt="Slide 4" />
            </SwiperSlide>
          </Swiper>
        </div>
      </section>

      {/* Rest of your sections... */}

    </>
  );
}

export default Home;
